Squeeze - Up the Junction [promo].VOB



Very HQ rare promo music video. Up the Junction&quot; was the third single released from Squeeze's second album, Cool for Cats. It is one of the band's most popular and well-remembered songs (especially in the UK), and reached #2 on the UK Singles Chart.

Cool for Cats is the British new wave group Squeeze's second album, released in 1979. Cool for Cats contained more charting hit singles (four) than any other album the band has released.

Up the Junction is a novel by Nell Dunn, first published in 1963. Lyricist Chris Difford said that the title phrase was lifted from the 1965 TV play version of the novel, directed by Ken Loach, and its subsequent 1968 movie remake. The film had a soundtrack by Manfred Mann, and a song by them, titled 'Up the Junction' Although the song is not derived, it includes several references to the drama.

This song is well known for its use of half-rhymes, such as &quot;ready&quot; and &quot;telly&quot; or &quot;kitchen&quot; and &quot;missing&quot;.

The band made a tongue-in-cheek performance of the &quot;Up the Junction&quot; on British chart show Top of the Pops in which band members play the 'wrong instrument', with singer Glenn Tilbrook drumming and Jools Holland (normally pianist) making minimal attempts to look at all proficient at the guitar.
